import React from "react";

const Navbar = ({ changeState }) => {
  return (
    <nav className="flex justify-between items-center bg-gradient-to-r from-blue-500 to-blue-700 text-white px-10 py-3 mb-4 shadow-lg">
      <h1 className="font-bold text-2xl">Taco's Tacos</h1>
      <button
        className="px-4 py-2 bg-white text-blue-700 font-semibold rounded-md shadow hover:bg-gray-200"
        onClick={changeState}
      >
        Switch Board
      </button>
    </nav>
  );
};

export default Navbar;
